export class Datas {
	constructor(url, id) {
		this.url = url;
		this.id = id;
	}

	getUserDatas() {
		const fetchUserData = async () => {
			try {
				const response = await fetch(this.url, this.id, {
					method: 'GET',
				});
				const data = await response.json();
				this.datas = data;
				console.log(data);
			} catch (error) {
				console.log(error);
			} finally {
				return this.datas;
			}
		};
		return fetchUserData();
	}
}
